import React from "react"
import './App.css';
import AboutMe from "./components/AboutMe"
import ContactInfo from "./components/ContactInfo"
import Projects from "./components/Projects"

const App = () => {
  return (
    <div className="App">
      <h1>Hi, I'm Raquel</h1>
      <AboutMe/>
      <ContactInfo/>
      <Projects/>
    </div>
  )
}

export default App
